// ================================================================================================
//
// Implementation of Member Function: getShapeFcOnPoint
// Shape functions evaluated on Point
// 
// ================================================================================================
inline std::vector<double> O2P2::Geom::Elem::Elem_Hex27::getShapeFcOnPoint(const double* Point) {
	std::vector<double> mi_Psi(27);

	mi_Psi.at( 0) = 0.125 * (Point[0] - 1.) * Point[0] * (Point[1] - 1.) * Point[1] * (Point[2] - 1.) * Point[2];
	mi_Psi.at( 1) = -0.25 * (Point[0] - 1.) * (Point[0] + 1.) * (Point[1] - 1.) * Point[1] * (Point[2] - 1.) * Point[2];
	mi_Psi.at( 2) = 0.125 * (Point[0] + 1.) * Point[0] * (Point[1] - 1.) * Point[1] * (Point[2] - 1.) * Point[2];
	mi_Psi.at( 3) = -0.25 * (Point[0] - 1.) * Point[0] * (Point[1] - 1.) * (Point[1] + 1.) * (Point[2] - 1.) * Point[2];
	mi_Psi.at( 4) = 0.5 * (Point[0] - 1.) * (Point[0] + 1.) * (Point[1] - 1.) * (Point[1] + 1.) * (Point[2] - 1.) * Point[2];
	mi_Psi.at( 5) = -0.25 * (Point[0] + 1.) * Point[0] * (Point[1] - 1.) * (Point[1] + 1.) * (Point[2] - 1.) * Point[2];
	mi_Psi.at( 6) = 0.125 * (Point[0] - 1.) * Point[0] * (Point[1] + 1.) * Point[1] * (Point[2] - 1.) * Point[2];
	mi_Psi.at( 7) = -0.25 * (Point[0] - 1.) * (Point[0] + 1.) * (Point[1] + 1.) * Point[1] * (Point[2] - 1.) * Point[2];
	mi_Psi.at( 8) = 0.125 * (Point[0] + 1.) * Point[0] * (Point[1] + 1.) * Point[1] * (Point[2] - 1.) * Point[2];
	mi_Psi.at( 9) = -0.25 * (Point[0] - 1.) * Point[0] * (Point[1] - 1.) * Point[1] * (Point[2] - 1.) * (Point[2] + 1.);
	mi_Psi.at(10) = 0.5 * (Point[0] - 1.) * (Point[0] + 1.) * (Point[1] - 1.) * Point[1] * (Point[2] - 1.) * (Point[2] + 1.);
	mi_Psi.at(11) = -0.25 * (Point[0] + 1.) * Point[0] * (Point[1] - 1.) * Point[1] * (Point[2] - 1.) * (Point[2] + 1.);
	mi_Psi.at(12) = 0.5 * (Point[0] - 1.) * Point[0] * (Point[1] - 1.) * (Point[1] + 1.) * (Point[2] - 1.) * (Point[2] + 1.);
	mi_Psi.at(13) = -1. * (Point[0] - 1.) * (Point[0] + 1.) * (Point[1] - 1.) * (Point[1] + 1.) * (Point[2] - 1.) * (Point[2] + 1.);
	mi_Psi.at(14) = 0.5 * Point[0] * (Point[0] + 1.) * (Point[1] - 1.) * (Point[1] + 1.) * (Point[2] - 1.) * (Point[2] + 1.);
	mi_Psi.at(15) = -0.25 * (Point[0] - 1.) * Point[0] * (Point[1] + 1.) * Point[1] * (Point[2] - 1.) * (Point[2] + 1.);
	mi_Psi.at(16) = 0.5 * (Point[0] - 1.) * (Point[0] + 1.) * Point[1] * (Point[1] + 1.) * (Point[2] - 1.) * (Point[2] + 1.);
	mi_Psi.at(17) = -0.25 * (Point[0] + 1.) * Point[0] * (Point[1] + 1.) * Point[1] * (Point[2] - 1.) * (Point[2] + 1.);
	mi_Psi.at(18) = 0.125 * (Point[0] - 1.) * Point[0] * (Point[1] - 1.) * Point[1] * (Point[2] + 1.) * Point[2];
	mi_Psi.at(19) = -0.25 * (Point[0] - 1.) * (Point[0] + 1.) * (Point[1] - 1.) * Point[1] * (Point[2] + 1.) * Point[2];
	mi_Psi.at(20) = 0.125 * (Point[0] + 1.) * Point[0] * (Point[1] - 1.) * Point[1] * (Point[2] + 1.) * Point[2];
	mi_Psi.at(21) = -0.25 * (Point[0] - 1.) * Point[0] * (Point[1] - 1.) * (Point[1] + 1.) * (Point[2] + 1.) * Point[2];
	mi_Psi.at(22) = 0.5 * (Point[0] - 1.) * (Point[0] + 1.) * (Point[1] - 1.) * (Point[1] + 1.) * Point[2] * (Point[2] + 1.);
	mi_Psi.at(23) = -0.25 * (Point[0] + 1.) * Point[0] * (Point[1] - 1.) * (Point[1] + 1.) * (Point[2] + 1.) * Point[2];
	mi_Psi.at(24) = 0.125 * (Point[0] - 1.) * Point[0] * (Point[1] + 1.) * Point[1] * (Point[2] + 1.) * Point[2];
	mi_Psi.at(25) = -0.25 * (Point[0] - 1.) * (Point[0] + 1.) * (Point[1] + 1.) * Point[1] * (Point[2] + 1.) * Point[2];
	mi_Psi.at(26) = 0.125 * (Point[0] + 1.) * Point[0] * (Point[1] + 1.) * Point[1] * (Point[2] + 1.) * Point[2];

	return mi_Psi;
};

